window.bookSummaryJSON = "<p>In the year 2280, an alien fleet stole our Earth. </p> <p>For 50 years they hunted us. For 50 years they enslaved us. For 50 years we lived in fear. </p> <p>Nothing lasts forever. </p> <p>They can try to quell us. They can try to break us. They can chase us to the ends of the Earth. They can chase us to the ends of the universe. </p> <p>We've won our first battle. We've earned our first taste of hope. What was theirs will soon be ours. </p> <p>We are the rebellion. Our story continues. </p>"; 
